1Ô∏è‚É£ Lebihan air simpanan yang rendah (sekitar 1-3% sahaja).

Maksudnya, kalau tiba-tiba ada masalah bekalan air (untuk kerja penyelenggaraan, berlaku pencemaran sumber air, dsb), Air Selangor tidak ada "back-up" yang cukup untuk "cover" beberapa hari yang bermasalah tersebut.

Mengapa ini berlaku? Sebab kurangnya pelaburan oleh kerajaan terdahulu untuk menanaik taraf sistem perpaipan yang uzur dan menambah kapasiti loji rawatan air (water treatment plant - WTP).

Setelah kerajaan Pakatan Rakyat (dan kini Pakatan Harapan) mengambil alih, pelan penaiktarafan sebenarnya sudah berjalan (cuma mengambil masa untuk siap).

Kerajaan negeri melaburkan lebih RM1 billion untuk usaha menaiktaraf keseluruhan infrastruktur.

Ini bukan pelaburan kecil (nilai ini lebih kurang 30% daripada pendapatan tahunan negeri Selangor) dan menunjukkan keseriusan kerajaan negeri menangani masalah ini.
